import React from "react";
import './TodoCounter.css';

function TodoCounter({total, completed}){

    return (
        <div  className="TodoCounter">
        <h2>ToDo App</h2>
        <p>Has completado {completed} de {total} Tareas</p>
        </div>
    )
};
export {TodoCounter};
